import { useEffect, useState } from 'react';
import './TimeSaving.css';

function TimeSaving() {
  const [routes, setRoutes] = useState([
    { source: 'Bengaluru', destination: 'Hyderabad', bestRoute: 'NH44 via Kurnool' },
    { source: 'Mumbai', destination: 'Pune', bestRoute: 'Mumbai-Pune Expressway' },
    { source: 'Chennai', destination: 'Bengaluru', bestRoute: 'NH48 via Vellore' },
    { source: 'Delhi', destination: 'Agra', bestRoute: 'Yamuna Expressway' },
    { source: 'Kolkata', destination: 'Durgapur', bestRoute: 'NH19 via Dankuni' }
  ]);

  return (
    <div className="timesaving-container">
      <div className="timesaving-wrapper">
        <h2 className="heading">⏱️ Time-Saving Route Suggestions</h2>
        <table className="route-table">
          <thead>
            <tr>
              <th>Source</th>
              <th>Destination</th>
              <th>Best Route</th>
            </tr>
          </thead>
          <tbody>
            {routes.map((route, index) => (
              <tr key={index}>
                <td>{route.source}</td>
                <td>{route.destination}</td>
                <td>{route.bestRoute}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default TimeSaving;
